// Header.js
import React from 'react';
import ReactTyped from 'react-typed';

const Header = () => {
    return (
      <div>
        <h1>
        you are so <br/>
        </h1>
        <header>
          <ReactTyped strings={["on track"]} typeSpeed={100} loop={false}/>
        </header>
      </div>
    );
  };

export default Header;
